		<h1>Home Page</h1>
	</div>
     
	{/* Calling to the methods */}
	<ul>
        <li>
          {/* Endpoint to route to Home component */}
          <Link to="/">Home</Link>
        </li>
        <li>
          {/* Endpoint to route to About component */}
          <Link to="/login">About</Link>
        </li>
        <li>
          {/* Endpoint to route to Contact Us component */}
          <Link to="/registration">Contact Us</Link>
        </li>
      </ul>

	
	</div>
);
}
